Embarrassing Bodies: Series 5

Health-Medical Documentary hosted by Ashley Jenson, published by Channel 4 in 2013 - English narration


Information
------------------------------

Embarrassing Bodies Series 5
The nation's favourite doctors are back for a fifth series, with tropical disease specialist Dr James Logan joining the team.


1)  Part 1 
Dr Dawn and Dr James head for Thailand to hunt down the embarrassing souvenirs Brits could be bringing home with them after a trip abroad. Dr Logan bravely infests himself with parasitic hookworm, while back in the UK Dr Pixie meets Carol who has an addiction to coffee enemas. And a woman who was one of the first generation to have breast enhancement surgery asks Dr Christian for help.

2)  Part 2 
The show travels to Thailand, offering on-the-spot medical advice to those with tropical troubles. Dr James continues his 60-day experiment of living with hookworm buried inside his intestine. In the clinic, Dr Christian helps a woman who had botched cosmetic surgery in Thailand. Dr Pixie sees a patient whose large breasts are ruining her life. Twenty-one-year-old Caroline's diabetes is damaging her sex life and 59-year-old Jarvis is worried about the risk of prostate cancer.

3)  Part 3 
The unshockable doctor's tour continues in their search for cringe-worthy conditions in need of a fix. For the first time Dr Christian hits the party island of Ibiza, tackling the issues of too much sun, sea and sex, pitching up a clinic on the beach for clubbers in need, and offering on the spot STI tests for Chlamydia and Gonorrhoea. Back in the UK Dr Dawn meets a man whose buried penis is causing peeing problems. And Dr Pixie advises a young girl with an extreme case bad breath caused by swollen tonsils. Dr James the dentist is back to treat every kind of dental disaster. And the show meets a cyclist whose potentially fatal blood condition hasn't stopped him aiming for Olympic glory.

4)  Part 4 
Dr Christian helps a patient with a vasectomy. Dr Dawn meets a woman whose bowel condition has left her with shocking stomach scars. She also meets a woman who needs advice about her head-banging bedtime behaviour. The seaside tour continues as the truck stops off at Skegness, where there's a man with a wriggly bottom, and another man with a worrying lump on his testicles. Dr Pixie hits the streets and helps the women of Skegness get the measure of obesity. And Dr Christian asks a team of BMX bikers to produce a sperm sample.

5)  Part 5 
Dr Christian helps a man whose rare genetic condition has left him needing new ears. Dr Pixie meets a patient with a leaky back passage. Dr Dawn meets Helen, who has a very unusual symptom - she can see faeces moving inside her intestines. The mobile clinic visits a music festival in the North East, where Dr Pixie sees a lad whose testicles are causing him trouble and a woman with a sizeable breast problem.

6)  Part 6 
The doctors visit Tamworth, where Dr Pixie helps a man whose oozing bottom wound hasn't healed in six years. Dr Christian meets a woman with a mysterious whistle. The show meets an art student fitted with pacemakers in his chest. Dr Pixie visits a pop festival in Staffordshire, where microbiologist Professor Val conducts a forensic examination of the loos. And Dr Dawn gives her top tips on everything you need to know about nipples.

7)  Part 7 
Dr Christian heads to Brighton where he meets a man with bother below the belt and a woman with very different breasts. Back at the clinic Dr Pixie meets a guy whose massive weight loss has left him with some unwanted baggage. Dr Dawn helps a little girl who's having trouble in the toilet department and Dr Christian sees a man with a pimple on his penis. Also resident dentist Dr James meets a woman with the worst decay he has ever seen. And in Thailand Dr Dawn asks some lads to have a feel of her prosthetic balls.

8)  Part 8 
The team hits the highlands, and Dr Dawn sets up camp at a festival where she meets a man with a problem under his kilt and a couple whose night of passion turned into a balls-up. Professor Val gets up close and personal with sweat, Dr Pixie hears about the condition that's stopping a woman from having sex, Dr Christian meets a woman who's been struggling to hide her growing problem for seven years, and two sisters discuss their rare skin condition that means each night they grow as much skin as most people would in 14 days.

9)  Part 9 
The doctors look back at some of their bumpiest cases. Nine months after they first met, the team catch up with the woman who had two large cysts on her head. Dr Dawn is in the Costa del Sol to see a man with a massive hernia. Dr Pixie revisits a woman who picked food out of the pits of her tonsils. And Dr Christian uses a box of willies to teach everyone the difference between good lumps and bad. And how is the patient doing whose nose was ruining his confidence?

10)  Part 10 
The team revisits several memorable cases, including a man whose symptom of leaking milk was the first sign of a much more serious condition. Dr Pixie helped a woman with three nipples and a woman desperate to rebalance her imbalanced breasts. Dr Dawn and Dr Pixie show how to self check for breast cancer and which lumps to worry about and what to get checked out. And, it's not just the ladies; men have a whole host of boob worries too. So, whether it's your man boobs or bosoms, the doctors will be revealing all that you need to know to keep your breasts at their best.

